import react from 'react';
import {form,input} from 'bootstrap';
import {useFormik} from 'formik';

const RentalForm = () => {

   const formik = useFormik({
     
    initialValues:{
        exampleInputEmail1: '',
        exampleInputPassword1: '',
        exampleCheck1: ''
    }

   })

   console.log('Form Values', formik.values)
  return (
    <div>
      <form>
  <div class="mb-3">
    <label for="exampleInputEmail1" class="form-label">Email address</label>
    <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"
     onChange={formik.handleChange} value={formik.values.exampleInputEmail1} />
  </div>
  <div class="mb-3">
    <label for="exampleInputPassword1" class="form-label">Password</label>
    <input type="password" class="form-control" id="exampleInputPassword1" 
    onChange={formik.handleChange} value={formik.values.exampleInputPassword1} />
  </div>
  <div class="mb-3 form-check">
    <input type="checkbox" class="form-check-input" id="exampleCheck1"
    onChange={formik.handleChange} value={formik.values.exampleCheck1} />
    <label class="form-check-label" for="exampleCheck1">Check me out</label>
  </div>
  <button type="submit" class="btn btn-primary">Submit</button>
</form>
    </div>
  )
}

export default RentalForm
